import React from "react";
import firstPhoto from "../assets/maninheadphones.jpg";

const Section1 = () => {
  return (
    <section className="Section1">
      <div>
        <img src={firstPhoto} style={{ width: "50%" }} />
      </div>
      <div>
        <h2>Take your podcast to the</h2>
        <h2>next level</h2>
      </div>
    </section>
  );
};

export default Section1;
